import React from 'react'
import { LoginForm, LogoutButton, SignupForm } from './pages/signUpIn/useFront';

export default function GetStarted() {
  return (
<div>
    <div>
      <h2>Login</h2>
      <LoginForm />
    </div>
    <div>
      <h2>SignupForm</h2>
      <SignupForm />
    </div>
</div>
  )
}
